bject(L.b)("p",null,'The task of source separation has relied on what has become a standard\nset of metrics for the past 15 years. These metrics have been the basis\nfor evaluating the latest "state-of-the-art", and for determining when\ndesign choices are good or bad. Yet a number of articles have shown that\nthese metrics are limited in how well they correlate with human\nperception. This talk gives a history of the metrics, their evolution,\nimplementations, and what we use today. Then, we dive into the\nmathematical properties of these metrics and give illustrative examples.\nWe conclude with a short survey of alternative metrics from the\nliterature, and criterion for what we might consider when defining a new\nstandard.'),Object(L.b)("table",null,Object(L.b)("tr",null,Object(L.b)("td",null,Object(L.b)("img",{width:"80px",style:{marginRight:"1em"},src:"/rachel.jpg"})),Object(L.b)("td",null,"Rachel is a Senior Research Scientist at Spotify in Paris. Her research interests are at the intersection of audio signal processing and machine learning, applied to musical audio. She is an active contributor to the open-source community, including being the primary developer of the pysox and mirdata Python libraries."))),Object(L.b)("h3",null,"Symposium: New applications of music separation for the music industry"),Object(L.b)("p",null,"This panel will discuss applications of music source separation within the\nmusic industry, with an emphasis on both current uses (e.g. remixes, sync\nlicensing) as well as emerging areas (spatial audio, adaptive music, gaming,\netc.). What are the challenges and opportunities in trying to bring source\nseparation to the music industry? What areas of research appear the most\nfruitful? What is the tension between research and productization?"),Object(L.b)("h4",null,"Panelists"),Object(L.b)("p",null,"Moderated\nby Antoine Liutkus (INRIA), our panel will bring together a researcher, a\nstart-up CEO, and a director from the music industry."),O